import {LOGIN} from '../types/types';

const login = (state, payload)=> {
    console.log(state);
    console.log(payload);
    return console.log('fonction login appele')
}


const rootReducer = (state = '', action) => {
    switch(action.type ){
        case LOGIN:
            return login( state, action.payload);
    }
}
export default rootReducer;
